import React from 'react'
import ReactDOM from 'react-dom'

function Nav(){
    return(
        <header>
            <nav>
                <img src={require('./images/willamreads.png')} width="40px" />
                <h1>Blog Page</h1>
                <ul>
                    <li>Home</li>
                    <li>Projects</li>
                    <li>Blog Page</li>
                    <li>About</li>
                </ul>
            </nav>
        </header>
    )
}

function Page(){
    return(
        <>
            <Nav />
        </>
    )
}

ReactDOM.render(<Page />, document.getElementById("root"));
